var lW = effect('Shape Control')('Sleeve Lower Width');
var h = effect('Shape Control')('Sleeve Height');
if (effect('Shape Control')('Hide Sleeve Upper Rounding') == 1) {
    var uR = 0;
} else {
    var uR = Math.max($bm_div(effect('Shape Control')('Sleeve Upper Roundness'), 2), $bm_div(effect('Shape Control')('Main Shape Upper Roundness'), 2));
}
if (effect('Shape Control')('Hide Sleeve Lower Rounding') == 1) {
    var lR = 0;
} else {
    var lR = $bm_div(effect('Shape Control')('Sleeve Lower Roundness'), 2);
}
var magicRatio = 9 / 16;
var p1 = [
    0,
    0
];
var p2 = [
    uW / 2,
    -uR
];
var p3 = [
    uW,
    0
];
var p4 = [
    uW / 2 + lW / 2,
    h
];
var p5 = [
    uW / 2,
    h + lR
];
var p6 = [
    uW / 2 - lW / 2,
    h
];
var p7 = [
    uW / 2 - lW / 2 + lR,
    h + lR
];
var p8 = [
    uW / 2 - lW / 2,
    h
];
var points = [
    p1,
    p2,
    p3,
    p4,
    p5,
    p6
];
var inT1 = [
    0,
    0
];
var inT2 = [
    -uW / 2 * magicRatio,
    0
];
var inT3 = [
    0,
    -uR * magicRatio
];
var inT4 = [
    0,
    0
];
var inT5 = [
    lW / 2 * magicRatio,
    0
];
var inT6 = [
    0,
    lR * magicRatio
];
var inT7 = [
    0,
    0
];
var inT8 = [
    0,
    0
];
var inTangens = [
    inT1,
    inT2,
    inT3,
    inT4,
    inT5,
    inT6
];
var outT1 = [
    0,
    -uR * magicRatio
];
var outT2 = [
    uW / 2 * magicRatio,
    0
];
var outT3 = [
    0,
    0
];
var outT4 = [
    0,
    lR * magicRatio
];
var outT5 = [
    -lW / 2 * magicRatio,
    0
];
var outT6 = [
    0,
    0
];
var outT7 = [
    -lR * magicRatio,
    0
];
var outT8 = [
    0,
    lR / 2
];
var outTangens = [
    outT1,
    outT2,
    outT3,
    outT4,
    outT5,
    outT6
];
$bm_rt = createPath(points, inTangens, outTangens, true);

